import React from "react";
import "../styles/container.css";
import "../styles/header.css";


function Error() {
    return (
        <div>
            <nav className="bar2">
                <a className="title2">Popular Titles</a>
            </nav>
            <div className="contenedor">
                Oops, something went wrong!
            </div>

        </div>
    );
}

export default Error;
